AAAACAAAAAAAAAAAAAAAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAIAAAAAAAAAAAAAAAAAAAAAAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAGARCVCmEIuPfjZVD6AEAACAAAAADAAAAIACAAACAAAAAAAAEAAAAACAAAAAAAAAAAAABAAAAAAAAAAAAAAgAAABAAAAAAAAAAAAAIAAAIgIAAAAAAAAAAA\",null,null,[[[1,189]\n]\n,7,null,0,196]\n]\n,null,\"〒907-0332 沖縄県石垣市伊原間\",null,null,\"https://www.google.com/maps/preview/place/%E3%80%92907-0332+%E6%B2%96%E7%B8%84%E7%9C%8C%E7%9F%B3%E5%9E%A3%E5%B8%82%E4%BC%8A%E5%8E%9F%E9%96%93+%E7%8E%89%E5%8F%96%E5%B4%8E%E5%B1%95%E6%9C%9B%E5%8F%B0/@24.4906333,124.2789083,3631a,13.1y/data\\u003d!4m2!3m1!1s0x345fef0be8e40c79:0x2102aaf8688c33d3\",1,null,null,null,null,null,[\"https://business.google.com/create?fp\\u003d2378651537087673299\\u0026hl\\u003dja\\u0026authuser\\u003d0\\u0026gmbsrc\\u003djp-ja-et-ip-z-gmb-s-z-l~mrc%7Cclaimbz%7Cu\\u0026ppsrc\\u003dGMBMI\\u0026utm_campaign\\u003djp-ja-et-ip-z-gmb-s-z-l~mrc%7Cclaimbz%7Cu\\u0026utm_source\\u003dgmb_mrc81\\u0026utm_medium\\u003det\\u0026getstarted\",\"ビジネス オーナーですか？\",null,\"0ahUKEwjQ6Kn_gtLvAhUHbKwKHbQFA_YQ_1kIOSgVMAA\"]\n,null,null,[[[[\"/url?q\\u003dhttps://www.google.com/maps/contrib/114402788934849348808%3Fhl%3Dja-JP\\u0026sa\\u003dU\\u0026ved\\u003d0ahUKEwjQ6Kn_gtLvAhUHbKwKHbQFA_YQ4h4IPCgAMAA\\u0026usg\\u003dAOvVaw3xEB2necP1DJ262FuzGWup\",\"Comers True Dream\",\"https://lh3.googleusercontent.com/a-/AOh14GgAtH0gHrhrDAwbIyI3OzofYpHrWFv_tMerLBRE5_M\\u003dc0x00000000-cc-rp-ba6\",\"0ahUKEwjQ6Kn_gtLvAhUHbKwKHbQFA_YQ4h4IPCgAMAA\"]\n,\"1 週間前\",null,\"早朝5時の暗闇に自転車を飛ばして朝日を見に行きました‼️\\n\\n西表石垣国立公園\\n(Iriomote-Ishigaki National Park)\\n西表石垣国立公園は、日本列島南西端に位置する国立公園です。西表島、石垣島、その間にはさまれたサンゴ礁の海(石西礁湖)と島々からなります。面積８０％が亜熱帯林に覆われた西表島は、イリオモテヤマネコなど希少な野生動物も多く生息しています。優れた海中景観を持つ石西礁湖は、日本最大規模のサンゴ礁でその海域にサンゴ礁の隆起でできた竹富島、黒島などに沖縄独特の集落景観が観られます。八重山諸島の玄関口となる石垣島は、島の中心に亜熱帯の森林がまとまって見られる於茂登岳があるほか、沿岸には北半球最大規模のアオサンゴ大群落がある白保など優れた海中景観が見られます。\\n\\n玉取崎園地\\nTamatorizaki area\\n平久保半島・野底・玉取崎　Tamatorizaki, Nosoko, hirakubo Peninsula\\n玉取崎は平久保半島の基部、金武山の東方に位置する岬です。南方には民謡「月夜浜節」に謡われた「岸の浦(キシヌーラ)」または「南の浦(ハイノーラ)」と呼ばれる場所があります。展望台からは、山並みや牧野、自然海岸とエメラルドのリーフの雄大な連なりが一望できます。平久保半島の付け根、約200mのくびれた箇所は「船越(フナクヤー)」と言われ、かつては、海から海へと舟を担いで渡していたと言われています。\\n\\n野底マーペー\\n西方に望む、とがった形が特徴の野底岳は、この山にまつわる、悲恋の物語のヒロインの名前をとって「野底マーペー」とも呼ばれます。過去の移住政策によって、恋仲をさかれたマーペーという娘が、黒島の恋人を思って野底岳に登ったが、於茂登岳にさえぎられて島の姿さえ見えず、絶望のあまり石になってしまったと言います。\\n\\n月夜浜節\\n１　月夜濱だぎに\\n岸ぬ浦ぬ木綿\\n木綿花作てぃ\\n木綿かしかきら\\n２　くりかえし　返えし\\n指はぢき　見上ぎりば\\n筋むつぃぬ　美らさ\\nゆみ美らさあむぬ\\n吹かば飛ぶ手巾\\n玉取崎園地周辺は昔、綿花の畑が一帯に広がっていました。この歌は、畑に真っ白に咲き誇る木綿の花はまるで月夜の浜辺のようだ。真っ白な綿花を摘み、糸を紡ぎ、愛しいひとのために、極上の手巾を織りさしあげましょう、という内容です。\\n\\n玉取崎の名前の由来は、その昔、この岬の沖で海難事故が多く、「魂を取られる」ことが多かったことから、「玉取」の名がついたそうです。\",4,null,\"114402788934849348808\",[\"https://www.google.com/local/review/rap/report?postId\\u003dChdDSUhNMG9nS0VJQ0FnSUR5dzd1UjBBRRAB\\u0026entityid\\u003dChdDSUhNMG9nS0VJQ0FnSUR5dzd1UjBBRRItChZDSUhNMG9nS0VJQ0FnSUR5dzd1Uk1BEhNDZ3dJc3FIQ2dnWVF3TkdXc3dNGi4KF0NJSE0wb2dLRUlDQWdJRHl3N3VSc0FFEhNDZ3dJc3FIQ2dnWVF3TkdXc3dNIhIJeQzk6AvvXzQR0zOMaPiqAiEqE0Nnd0lzNkhDZ2dZUTRMak84Z0U\\u0026wv\\u003d1\\u0026s\\u003d81\",\"違反コンテンツを報告\",null,\"0ahUKEwjQ6Kn_gtLvAhUHbKwKHbQFA_YQoykIPigCMAA\"]\n,null,null,\"ChdDSUhNMG9nS0VJQ0FnSUR5dzd1UjBBRRAB\",\"0ahUKEwjQ6Kn_gtLvAhUHbKwKHbQFA_YQ4R4IOygAMAA\",[null,[[8,null,1]\n,49,3047,\"https://lh3.googleusercontent.com/a-/AOh14GgAtH0gHrhrDAwbIyI3OzofYpHrWFv_tMerLBRE5_M\\u003dc0x00000000-cc-rp-ba6\",\"Comers True Dream\",\"https://www.google.com/maps/contrib/114402788934849348808?hl\\u003dja-JP\",null,null,\"https://www.google.com/maps/contrib/114402788934849348808?hl\\u003dja-JP\"]\n,\"C\"]\n,null,[[\"AF1QipMjpyvAiW9Q7K_3tCc_WXa5lkNs_MCP7ouuTapL\",null,null,null,null,null,[\"https://lh5.googleusercontent.com/p/AF1QipMjpyvAiW9Q7K_3tCc_WXa5lkNs_MCP7ouuTapL\\u003dw150-h150-k-no-p\"]\n,null,null,\"_PRfYNB6h9ixBbSLjLAP\",\"0ahUKEwjQ6Kn_gtLvAhUHbKwKHbQFA_YQzCcIPygDMAA\",[\"//www.google.com/cbk?output\\u003dreport\\u0026cb_client\\u003dmaps_sv.tactile\\u0026image_key\\u003d!1e10!2sAF1QipMjpyvAiW9Q7K_3tCc_WXa5lkNs_MCP7ouuTapL\",null,nul
